import React from "react";
import { Col, Row } from "react-grid-system";

class Temp extends React.Component {
  render() {
    return (
      <div className="temp">
        <Row align="center" justify="center">
          <Col md={12}>
            <img src={require("./images/dcoloaddesktop.gif")} />
          </Col>
        </Row>
      </div>
    );
  }
}

export default Temp;
